import React from "react";

function Test() {
  //   const styles = {
  //     container: {
  //       backgroundColor: "#f0f0f0",
  //       padding: "20px",
  //       borderRadius: "8px",
  //       textAlign: "center",
  //     },
  //     heading: {
  //       color: "#333",
  //       fontSize: "24px",
  //     },
  //     button: {
  //       backgroundColor: "#007bff",
  //       color: "#fff",
  //       padding: "10px 20px",
  //       border: "none",
  //       borderRadius: "5px",
  //       cursor: "pointer",
  //     },
  //   };

  return (
    <div class="bg-[#272829] rounded-xl h-12 relative">
      <div class="bg-[#272829] rounded-md absolute right-[290px] left-5 bottom-1.5 top-1.5">
        <div class="bg-[#914bf1] rounded-md w-[100%] h-[100%] absolute right-[0%] left-[0%] bottom-[0%] top-[0%]"></div>
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg0.svg"
          />
        </div>
      </div>
      <div class="bg-[#272829] rounded-md absolute right-[236px] left-[74px] bottom-1.5 top-1.5">
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg1.svg"
          />
        </div>
      </div>
      <div class="bg-[#272829] rounded-md absolute right-[182px] left-32 bottom-1.5 top-1.5">
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg2.svg"
          />
        </div>
      </div>
      <div class="bg-[#272829] rounded-md absolute right-32 left-[182px] bottom-1.5 top-1.5">
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg3.svg"
          />
        </div>
      </div>
      <div class="bg-[#272829] rounded-md absolute right-[74px] left-[236px] bottom-1.5 top-1.5">
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg4.svg"
          />
        </div>
      </div>
      <div class="bg-[#272829] rounded-md absolute right-5 left-[290px] bottom-1.5 top-1.5">
        <div
          class="rounded-md w-7 h-7 absolute left-[50%] top-[50%] overflow-hidden"
          style="translate: -50% -50%"
        >
          <img
            class="h-[auto] absolute right-1 left-1 bottom-1 top-1 overflow-visible"
            src="svg5.svg"
          />
        </div>
      </div>
    </div>
  );
}
export default Test;
